    public function testGetAllOpen():void {
        if ($this->websocketMock) {
            $this->websocketMock
                ->expects($this->once())
                ->method('send')
                ->withConsecutive(
                    [$this->callback(function(BaseRequest $req) { return $req->setId(1)->toJson() === '{"jsonrpc":"2.0","id":1,"method":"call","params":[0,"get_open_buyings",[]]}'; })]
                )
                ->will($this->onConsecutiveCalls(
                    GetOpenBuyings::responseToModel(new BaseResponse('{"id":1,"result":[]}'))
                ));
        }

        $purchases = $this->sdk->getPurchaseApi()->getAllOpen();

        foreach ($purchases as $purchase) {
            $this->assertInstanceOf(Purchase::class, $purchase);
        }

        $this->assertInternalType('array', $purchases);
    }

